window.bookSummaryJSON = "<p>You can say goodbye to today's Internet,<i> New York Times</i> best-selling author George Gilder says. Soon the current model of aggregated free content populated with \"value-subtracted\" advertising will die a natural death, due, of course, to the simple fact that absolutely no one wants to see online advertising. What will tomorrow's Internet look like?</p> <p>In <i>Life After Google</i>, Gilder takes listeners on a brilliant, rocketing journey into the very near-future, into an Internet with a new \"bitcoin-bitgold\" transaction layer that will replace spam with seamless micro-payments and provide an all-new standard for global money.</p>"; 
